import React, { Component } from 'react';

export default class Home extends Component {
  constructor() {
    super();
    //Set default message
    this.state = {
      message: 'Loading...'
    }
  }  componentDidMount() {
    //GET message from server using fetch api
    fetch('/auth/secret')
      .then(res => res.text())
      .then(res => this.setState({message: res}));
  }  render() {
    return (
      <div>
        <h1>Home</h1>
        <p>{this.state.message}</p>
      </div>
    );
  }}
